import { TextField } from "@mui/material";
import { Component } from "react";
import image from "./images/signUp.png";

function Login() {
    return (
        <>
            <img src={image} />
            <Component>
                <TextField variant="stan" />
            </Component>
        </>
    );
}
export default Login;
